import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';

const DashboardPage = () => {
  const location = useLocation();
  const { user } = location.state || {};
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear user information and redirect to login page
    navigate('/login', { state: { user: null } });
  };

  if (!user) {
    // Handle case where user details are not available
    return (
      <div>
        <p>User details not available.</p>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
    <header>
      <nav>
        <ul>
          <li>Home</li>
          <li>Contact</li>
          <li onClick={handleLogout}>Logout</li>
        </ul>
      </nav>
      <h1>Service Provider Dashboard</h1>
      {/* Additional content specific to the Service Provider Dashboard */}
      <p>Manage your services efficiently.</p>
    </header>
    <main>
      <aside>
        <h2>Online Catalog</h2>
        <h2>Service Provider System Dashboard</h2>
        <ul>
          <li>Drone Management</li>
          <li>Drone Booking (3)</li>
          <li>Drone Fleet Tracing</li>
          <li>Service History ></li>
          <li>Drone Data</li>
        </ul>
      </aside>
      {/* Additional content specific to the Service Provider Dashboard */}
    </main>
  </div>
  );
};

export default DashboardPage;
